import "./App.css";
// import Form from "./Form";
import MapBasics from "./Map";
import MenuAppBar from "./Header";
import Footer from "./Footer";
import CustomizedInputs from "./Input";

function App() {
  return (
    <>
      <MenuAppBar></MenuAppBar>
      <div>
        {/* <Form></Form> */}
        <CustomizedInputs></CustomizedInputs>
      </div>
      <div
        style={{
          position: "absolute",
          right: "5%",
          top: "20%",
          zIndex: "-4px",
        }}
      >
        <MapBasics></MapBasics>
      </div>
      <Footer></Footer>
    </>
  );
}

export default App;
